# 此处仅提供一个简单的示例，具体实现起来方案有很多，可按需开发

require 'uri'
require 'net/http'

uri = URI('你的API接口地址')
# 入参
res = Net::HTTP.post_form(
    uri, 
    'api_token' => '你的token', 
    'upload_format' => 'base64', # 示例，使用base64方式上传，下面upload_format填写的是完整的base64地址
    'uploadedFile' => 'data:image/jpeg;base64,'
)
puts res.body  if res.is_a?(Net::HTTPSuccess)